import React from 'react';

function Header(){
    const title = "Design is my life"
    return(
        <div className="navbar bg-dark rounded">
        <h2 className="text-white">Design is my life</h2>
        <h1 className="text-white">{5*6}</h1>
        </div>
    );
}

export default Header;
